SELECT REGION.R_REGIONKEY, MIN(REGION.R_REGIONKEY) FROM REGION WHERE REGION.R_REGIONKEY > R FOXES. REGULAR EXCUSES ARE ABOUT THE QUICKLY REGULAR THEODOLITES. REGULAR,  AND REGION.R_NAME = 'AL, FINAL REQUESTS CAJOLE' GROUP BY REGION.R_REGIONKEY HAVING MIN(REGION.R_REGIONKEY) >= CUSTOMER ORDER BY MIN(REGION.R_REGIONKEY) ASC;
